import { Component } from '@angular/core';

@Component({
  selector: 'app-help-page',
  templateUrl: './help-page.component.html',
  styleUrls: ['./help-page.component.css'],
})
export class HelpPageComponent {
  //TODO export to interface
  faqs = [
    {
      question: 'What is Angular?',
      answer:
        'Angular is a TypeScript-based open-source web application framework developed by Google.',
    },
    {
      question: 'What is TypeScript?',
      answer:
        'TypeScript is a superset of JavaScript that adds optional static typing and other features to the language.',
    },
    {
      question: 'What is a component in Angular?',
      answer:
        'A component is a building block of an Angular application that encapsulates the data, behavior, and template of a part of the UI.',
    },
  ];

  toggleAnswer(faq: any) {
    faq.isOpen = !faq.isOpen;
  }


}
